import React from 'react';
import './newsletter.scss';
import PostandS from '../../components/posts and social/postSocial.comp';

const Newsletter=()=>(

    <section className="newsletter">
        <p></p>
        <div>
            <h2 className="newsl-tittle">Newsletter</h2>
            <PostandS className={true}/>
        </div>
        
    </section>

)

export default Newsletter;
